import React from "react";
import ReactDOM from "react-dom";
import Header from "./components/Header";
import Note from "./components/Note";
import Footer from "./components/Footer";

export default function App() {
  return (
    <html>
      <Header />
      <body>
        <Note />
        <Footer />
      </body>
    </html>
  );
}
